import React, { Component } from 'react';
class RecentlyDocument extends Component {
    render() { 
        return (  
            <div className="d-block" style={containerStyle}>
                <p className="h4 mb-2 text-dark ">Recently Document</p>
            </div>
        );
    }
}
const containerStyle = {
    paddingRight : '15%',
    paddingLeft : '15%'
};
export default RecentlyDocument
